import React from 'react';

interface RestaurantCardProps {
    id: number;
    name: string;
    cuisine: string;
    location: string;
    averageSpend: number;
}

const RestaurantCard: React.FC<RestaurantCardProps> = ({ id, name, cuisine, location, averageSpend }) => {
    return (
        <div className="restaurant-card" key={id}>
            <h2>{name}</h2>
            <p>Cuisine: {cuisine}</p>
            <p>Location: {location}</p>
            <p>Average Spend for 2: ${averageSpend}</p>
        </div>
    );
};

export default RestaurantCard;
